import React, { useState } from 'react';

import { Container, RadioContainer, CheckContainer } from './styles';

const InputRadio: React.FC = () => {
  const [isChecked, setIsChecked] = useState(false);
  return (
    <Container onClick={() => setIsChecked(!isChecked)}>
      {isChecked ? <CheckContainer /> : <RadioContainer />}
      <RadioContainer />
      <CheckContainer />
    </Container>
  );
};

export default InputRadio;
